<?phpnamespace Nemundo\Meteo\Meteocentrale\Install;use Nemundo\App\Application\Setup\ApplicationSetup;use Nemundo\App\Scheduler\Setup\SchedulerSetup;use Nemundo\Content\Setup\ContentTypeSetup;use Nemundo\Meteo\Meteocentrale\Application\MeteocentraleApplication;use Nemundo\Meteo\Meteocentrale\Content\Bisendiagramm\BisendiagrammContentType;use Nemundo\Meteo\Meteocentrale\Content\Foehndiagramm\FoehndiagrammContentType;use Nemundo\Meteo\Meteocentrale\Data\MeteocentraleModelCollection;use Nemundo\Meteo\Meteocentrale\Scheduler\FoehnBisendiagrammScheduler;use Nemundo\Model\Setup\ModelCollectionSetup;use Nemundo\App\Application\Type\Install\AbstractInstall;class MeteocentraleInstall extends AbstractInstall{    public function install()    {        (new ApplicationSetup())            ->addApplication(new MeteocentraleApplication());        (new ModelCollectionSetup())            ->addCollection(new MeteocentraleModelCollection());        (new SchedulerSetup(new MeteocentraleApplication()))            ->addScheduler(new FoehnBisendiagrammScheduler());        (new ContentTypeSetup(new MeteocentraleApplication()))            ->addContentType(new FoehndiagrammContentType())            ->addContentType(new BisendiagrammContentType());        (new FoehndiagrammContentType())->saveType();        (new BisendiagrammContentType())->saveType();    }}